import React, {Component} from 'react';
import './App.css';
import ClockCheckNow from './TodoList/ClockCheckNow.js';
import Todolist from './TodoList/Todolist.js'
import Welcome from './TodoList/Welcome.js'

class History_nav extends Component{
  render(){
    return(
      <nav>
        <div>LOGIN</div>
        <div>CALENDER</div>
        <div>STATICS</div>
      </nav>
    );
  }
}








function App() {
  var pressShift = false;
  var pressArrow = '';
  React.useEffect(() => {
    window.addEventListener('keydown', (e) => {
      if(e.shiftKey) pressShift = true;
      if( 37<= e.keyCode && e.keyCode <=40) pressArrow = e.key;
      console.log(pressShift + pressArrow);
    });

  }, [pressArrow]);

  return (
    <div className="App">
      <header className="App-header">

        <History_nav></History_nav>
        <Welcome ></Welcome>
        <ClockCheckNow></ClockCheckNow>
        <Todolist _pressArrow={pressArrow} _pressShift ={pressShift} ></Todolist>
      </header>
    </div>
  );
}

export default App;
